import './App.css';
import About from './components/About';
import Library from './components/Library';
import Navbar from './components/Navbar';
import Trade from './components/Trade';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
    <Router>
    <Navbar/>
    <Library/>
    <Routes>
    <Route path="/library">
            <Li/>
      </Route>
    <Route path="/about">
            <About/>
      </Route>
    <Route path="/trade">
            <Trade/>
      </Route>


      </Routes> 
    </Router> 

      <Navbar/>
    </>
  );
}

export default App;
